DataSet.ClientEvent:
var deliveryNo=${request.getParameter("deliveryNo")}+"";
if(deliveryNo){
	view.get("#formConditioin").set("entity",{'deliveryNo':deliveryNo});
	var data = view.get("#formConditioin.entity");
	with (view.get("#dataSetTbih16")){
		set("parameter", data);
		view.get("#dataSetTbih16").flush();
	}
	with (view.get("#dataSetTbih16a")){
		set("parameter", data);
		view.get("#dataSetTbih16a").flush();
	}
	var orderItemArry="";
	var entitysTbih16a=view.get("#dataSetTbih16a.data");
	entitysTbih16a.each(function(entityIh16a){
		orderItemArry=orderItemArry+entityIh16a.get("orderItem")+"','";
	});
	
	if(view.get("#dataSetTbih16").getData("#")){
		var entity=view.get("#dataSetTbih16").getData("#");
		view.get("#dataSetTbih30").set("parameter",
		{compId:entity.get("compId"),
		deliveryNo:entity.get("deliveryNo"),
		orderItemArry:"('"+orderItemArry.substring(0,orderItemArry.length-2)+")"});
		view.get("#dataSetTbih30").flushAsync();
	}
}

self.move=function(entities){
	var ds=view.id("dataSetTbih30");
	var dataLeft=ds.getData("#");
	if(dataLeft){
		var targetDataRight=view.id("dataSetTbih30Right").getData();
		var insertAble=true;
		targetDataRight.each(function(dataRight){
			if(dataRight.get("labelNo")==dataLeft.get("labelNo")){
				insertAble=false;
				return false;
			}
		});
		targetDataRight.insert(dataLeft.toJSON());
			dataLeft.remove();
	}else{
		dorado.MessageBox.alert("当前没有选中的需要货权转授的信息！")
	}	
}

self.move=function(entities){
	var ds=view.id("dataSetTbih30Right");
	var dataRight=ds.getData("#");
	if(dataRight){
		var targetDataLeft=view.id("dataSetTbih30").getData();
		var insertAble=true;
		targetDataLeft.each(function(dataLeft){
			if(dataRight.get("labelNo")==dataLeft.get("labelNo")){
				insertAble=false;
				return false;
			}
		});
		targetDataLeft.insert(dataRight.toJSON());
		dataRight.remove();
	}else{
		dorado.MessageBox.alert("当前没有选中的需要货权转授的信息！")
	}	
}

