var dgLeft = view.get("#dgTbih30Left");
var selectionLeft = dgLeft.get("selection");
if(selectionLeft.length>0){
	selectionLeft.each(function(dataLeft){
		var targetDataRight=view.id("dataSetTbih30Right").getData();
		var insertAble=true;
		targetDataRight.each(function(dataRight){
			if(dataRight.get("ih30Id")==dataLeft.get("ih30Id")){
				insertAble=false;
				return false;
			}
		});
		targetDataRight.insert(dataLeft.toJSON());
		dataLeft.remove();
	});
}else{
	dorado.MessageBox.alert("当前没有选中的需要配货的信息！")
}

var entityListRight = view.id("dataSetTbih30Right").getData();
var dgRight = view.get("#dgTbih30Right");
var selectionRight = dgRight.get("selection");
if(selectionRight.length>0){
	selectionRight.each(function(dataRight){
		var targetDataLeft=view.id("dataSetTbih30").getData();
		var insertAble=true;
		targetDataLeft.each(function(dataLeft){
			if(dataRight.get("ih30Id")==dataLeft.get("ih30Id")){
				insertAble=false;
				return false;
			}
		});
		targetDataLeft.insert(dataRight.toJSON());
		dataRight.remove();
		dgRight.refreshEntity(dataRight);
	});

	dgRight.refresh();
	
}else{
	dorado.MessageBox.alert("当前没有选中的需要左移的信息！")
}

var entityTbih16 = view.get("#dataSetTbih16a").getData("#");
var entityForm = view.get("#formConditioin.entity");
var dsTbih30Right = view.get("#dataSetTbih30Right").getData();
if(dsTbih30Right.entityCount>0){
	var ajaxActionPH = view.get("#ajaxActionPH");
	ajaxActionPH.set("parameter",{	
		'deliveryNo' : entityTbih16.get("deliveryNo"),
		'ListIh30' : dsTbih30Right
	});
	ajaxActionPH.execute(function(returnValue) {
		var flag = returnValue["flag"];
	    var msg = returnValue["msg"];
		var outNo = returnValue["outNo"];
		if(flag){
			if(outNo){
				var tabControl1 = view.get("#tabControl1");
				tabControl1.set("currentIndex", 1);
	//			alert(outNo);
				view.get("#formConditioinTab2").set("entity",{'outNo':outNo});
				
				var data = view.get("#formConditioinTab2.entity");
				with (view.get("#dataSetTbih19Info")){
					set("parameter", data);
					view.get("#dataSetTbih19Info").flush();
				}
				with (view.get("#dataSetTbih19")){
					set("parameter", data);
					view.get("#dataSetTbih19").flush();
				}
			}
			dorado.widget.NotifyTipManager.notify("配货成功");
			
		}
		
	});
}else{
	dorado.widget.alert("请先勾选需要配货的数据");
}

