ToolBarButton.ClientEvent:
var entityTbih19Info = view.get("#dataSetTbih19Info").getData("#");
var ListIh19 = view.get("#dataSetTbih19.data")
var ajaxActionSaveIh19Detail = view.get("#ajaxActionSaveIh19Detail");
ajaxActionSaveIh19Detail.set("parameter",{
	'ih19Info' : entityTbih19Info,		
	'ListIh19' : ListIh19,
	'cmdType' : "PHQR"
});
ajaxActionSaveIh19Detail.execute(function(returnValue) {
	var flag = returnValue["flag"];
    var msg = returnValue["msg"];
	var outNo = returnValue["outNo"];
	if(flag){
		dorado.widget.NotifyTipManager.notify("配货销帐确认成功");
		view.get("#formConditioinTab2").set("entity",{'outNo':outNo});
				
		var data = view.get("#formConditioinTab2.entity");
		with (view.get("#dataSetTbih19Info")){
			set("parameter", data);
			view.get("#dataSetTbih19Info").flush();
		}
		with (view.get("#dataSetTbih19")){
			set("parameter", data);
			view.get("#dataSetTbih19").flush();
		}
	}else{
		alert(msg);
	}
	
});

var entityTbih19Info = view.get("#dataSetTbih19Info").getData("#");
var ListIh19 = view.get("#dataSetTbih19.data")
var deleteIh19Detail = view.get("#ajaxActionDeleteTbih19Detail");
deleteIh19Detail.set("parameter",{	
	'ListIh19' : ListIh19
});
deleteIh19Detail.execute(function(returnValue) {
	var flag = returnValue["flag"];
    var msg = returnValue["msg"];
	var outNo = returnValue["outNo"];
	if(flag){
		dorado.widget.NotifyTipManager.notify("撤销成功");
		view.get("#formConditioinTab2").set("entity",{'outNo':outNo});
				
		var data = view.get("#formConditioinTab2.entity");
		with (view.get("#dataSetTbih19Info")){
			set("parameter", data);
			view.get("#dataSetTbih19Info").flush();
		}
		with (view.get("#dataSetTbih19")){
			set("parameter", data);
			view.get("#dataSetTbih19").flush();
		}
	}
	
});

var entityTbih19Info = view.get("#dataSetTbih19Info").getData("#");
var ListIh19 = view.get("#dataSetTbih19.data")
var ajaxActionSaveIh19Detail = view.get("#ajaxActionSaveIh19Detail");
ajaxActionSaveIh19Detail.set("parameter",{
	'ih19Info' : entityTbih19Info,		
	'ListIh19' : ListIh19,
	'cmdType' : "CKQR"
});
ajaxActionSaveIh19Detail.execute(function(returnValue) {
	var flag = returnValue["flag"];
    var msg = returnValue["msg"];
	var outNo = returnValue["outNo"];
	if(flag){
		dorado.widget.NotifyTipManager.notify("出库确认成功");
		view.get("#formConditioinTab2").set("entity",{'outNo':outNo});
				
		var data = view.get("#formConditioinTab2.entity");
		with (view.get("#dataSetTbih19Info")){
			set("parameter", data);
			view.get("#dataSetTbih19Info").flush();
		}
		with (view.get("#dataSetTbih19")){
			set("parameter", data);
			view.get("#dataSetTbih19").flush();
		}
		
		if(entityTbih19Info){
			var compId = entityTbih19Info.get("compId");
			var outNo = entityTbih19Info.get("outNo");
			if(outNo!=""){
			var localPath = "http://192.168.1.2:8080";
			localPath ="http://localhost:8080";
			var contextPath = "/jghz/ureport?action=htmlpreview&report=classpath:";
			var classPath = "com/jghz/ih/report/ihjc19"; 
			var parameter = "&outNo="+outNo+"&compId="+compId;
			var url = localPath+contextPath+classPath+parameter;
			window.open(url);
			}
		}else{
			view.get("#msg").set("text","消息提示： 请先查询需要打印的数据");
		}

	}
});

CustomDropDown.ClientEvent:
var data=view.id("dataSetTbih16").getData("#");
if(!data){
	dorado.MessageBox.alert("请先选中一个角色!");
	arg.processDefault=false;
	return;
}
var dialog=view.id("$dialogWareNo");
	dialog.$show({
		width:600,
		height:500,
		callback:function(selectArray){
			dialog.hide();
			data.set("outWareCode",selectArray["wareCode"]);
		}
	});

var dialog=view.id("$dialogOutNo");
	dialog.$show({
		width:800,
		height:300,
		callback:function(selectArray){
			dialog.hide();
			view.get("#formConditioinTab2").set("entity",{'outNo':selectArray["outNo"]});
		}
	});

